	scwin.Div_CmMetd05_oniframeload = function() {
		bLoadDivCmMetd05 = true;
		scwin.Div_OnLoadCompleted();
	};

	//Div_CmMetd03 load 완료시 호출
	scwin.Div_CmMetd03_oniframeload = function() {
		bLoadDivCmMetd03 = true;
		scwin.Div_OnLoadCompleted();
	};

	scwin.Div_OnLoadCompleted = function() {
		if (bLoadDivCmMetd05 && bLoadDivCmMetd03) {
			if (parent.Ds_LTIDA00.getCellData(0, "sCmMetd") == "") {
	            scwin.cmb_sCmMetd_OnChanged();
	        } else {
	        	scwin.cmb_sCmMetd_OnChanged();
	            switch (cmb_sCmMetd.getValue()) {
	                case "05":
	                    //자동이체
	                    Div.Ds_Args.setCellData(0, "sPlanNo", parent.Ds_LTIDA00.getCellData(0, "sPlanNo"));
	                    // 설계번호 (청약 필수, 변경 옵션)
	                    Div.Ds_LTIFA03.setCellData(0, "sPlanNo", parent.Ds_LTIDA00.getCellData(0, "sPlanNo"));
	                    // 설계번호 (청약 필수, 변경 옵션)
	                    break;
	                case "03":
	                    //카드입금
	                    Div1.Ds_Args.setCellData(0, "sPlanNo", parent.Ds_LTIDA00.getCellData(0, "sPlanNo"));
	                    // 설계번호 (청약 필수, 변경 옵션)
	                    Div1.Ds_LTIFA03.setCellData(0, "sPlanNo", parent.Ds_LTIDA00.getCellData(0, "sPlanNo"));
	                    // 설계번호 (청약 필수, 변경 옵션)
	                    break;
	                default:
	                    break;
	            }
	        }
	    }
	};

	scwin.fn_Init = function() {
		gfn_getServerTime();//서버시간
		gsSysDate = wconv.substr(gds.gDs_ServerTime.getCellData(0, "sToday"), 0, 8); 	// global 현재일자
		gUserID 		= util.getGdsValue("gUserID");    					// global 사용자 ID
		gUserEmpName 	= util.getGdsValue("gUserEmpName");    				// global 부서명
		gUserIP			= util.getGdsValue("gUserIP");						// global 사용자IP

		//EDD화면 팝업 버튼은 고액계약(1.월납이면서 5백만원초과, 2.일시납(비월납포함)이면서 2억초과)일경우만 활성화
		var sPaymCyclCd = parent.Ds_LTIDA00.getCellData(0,"sPaymCyclCd");		
		var nBussPrem = parent.Ds_LTIDA00.getCellData(0,"nBussPrem");

		if((sPaymCyclCd != "12" && wconv.toNumber(nBussPrem) > 200000000) ||
			(sPaymCyclCd == "12" && wconv.toNumber(nBussPrem) > 5000000)) {
			btn_EddCnfm.show();
		}
		else{
			btn_EddCnfm.hide();
		}

		//납입주기코드(공통)
//		DsWs_PaymCycl.copy(parent.DsWs_PaymCycl);//납입주기코드(공통)
		DsWs_PaymCycl.setJSON(parent.DsWs_PaymCycl.getAllJSON());	

		// 웹서비스 콜 
		var promise = Promise.resolve();
		promise = promise.then(function(rtnVal) {
			scwin.search_TPCallService();	

		});

		//cbs 추가
	    if (wconv.toNumber(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd")) == 57 || 
	    	wconv.toNumber(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd")) == 0 || 
	    	wconv.toNumber(parent.Ds_LTIDA00.getCellData(0, "sPlanProgRankCd")) == 90) {
	        parent.scwin.lfn_ComponentEnable(parent.Tab_Req_Step3, "", false);
	    }
	};

