	scwin.search_TPCallService = function() {	
		var sPlanNo = parent.Ds_LTIDA00.getCellData(0, "sPlanNo");//설계번호

		var MethodObj = new callService("com.inswave.longterm.ssr.pln.task.DBB330Task", "getInsPlan","","");
		MethodObj.setId("getInsPlan");
		MethodObj.setParam("sPlanNo", sPlanNo);//설계번호
		MethodObj.setUrl("/contract/CBSC042MController.do");
		//DsWs_LTIDA00
		MethodObj.setXPath("//hashtable/data[@hashkey='lTIDA00Doc']/LTIDA00");
		//DsWs_LTIEA10
		MethodObj.addXPath("//hashtable/data[@hashkey='lTIEA10Doc']/LTIEA10");//단체사항
		//DsWs_LTIDA03
		MethodObj.addXPath("//hashtable/data[@hashkey='lTIDA03Doc']/LTIDA03");//계약자사항
		//DsWs_LTIDA07
		MethodObj.addXPath("//hashtable/data[@hashkey='lTIDA07ListDoc']/vector/data/LTIDA07");
		//DsWs_PaymCycl
		MethodObj.addXPath("//hashtable/data[@hashkey='paymCyclCdList']/vector/data/multi");
		MethodObj.addXPath("//WARNING");		
	//	MethodObj.setXPathDs();
		MethodObj.sync();
		MethodObj.send();

		wconv.clear(DsWs_Warning);
		util.jSonDsCreate(_tranSync.getDsJson("WARNING"), DsWs_Warning.getID(), "Y");       
	    // 오류처리
	    if (DsWs_Warning.getRowCount() != 0) {
	        wprom.alert(DsWs_Warning.getCellData(0, "msg"));
	        return;
	    } else {
	    	//DsWs_LTIDA00
	    	wconv.clear(DsWs_LTIDA00);
			util.jSonDsCreate(_tranSync.getDsJson("LTIDA00"), DsWs_LTIDA00.getID(), "Y");  
			//DsWs_LTIEA10
			wconv.clear(DsWs_LTIEA10);
			util.jSonDsCreate(_tranSync.getDsJson("LTIEA10"), DsWs_LTIEA10.getID(), "Y");
			//DsWs_LTIDA03
			wconv.clear(DsWs_LTIDA03);
			util.jSonDsCreate(_tranSync.getDsJson("LTIDA03"), DsWs_LTIDA03.getID(), "Y");
			//DsWs_LTIDA07
			wconv.clear(DsWs_LTIDA07);
			util.jSonDsCreate(_tranSync.getDsJson("LTIDA07"), DsWs_LTIDA07.getID(), "Y");
			//DsWs_PaymCycl	
			wconv.clear(DsWs_PaymCycl);
			util.jSonDsCreate(_tranSync.getDsJson("multi"), DsWs_PaymCycl.getID(), "Y");		

	    	//계약기본정보의 보험료를 세팅
	    	wconv.clear(Ds_LTIEA10);
       	 	util.copyM(Ds_LTIEA10, DsWs_LTIEA10.getAllJSON(),true);
       	 	util.setCompBindRefresh(Ds_LTIEA10.getID());
       	 	util.setRowPosition(Ds_LTIEA10, 0);

       	 	//단체할인율
       	 	var nGroupDcrt  = wconv.toNumber(Ds_LTIEA10.getCellData(0, "nGroupDcrt"))*100;
			Ds_LTIEA10.setCellData(0, "nGroupDcrt", wconv.toString(nGroupDcrt));

			//계약자mask 세팅
			scwin.medt_sCrtorCd_onviewchange();
			//계약자코드
//			medt_sCrtorCd.setDisabled(true);
			//영업보험료 
//			medt_nBussPrem.setDisabled(true);

			var sRvadAddr = "("+ DsWs_LTIDA03.getCellData(0, "sMailRvadAddrFlagName") + ") " + edt_RvadAddr.getValue();
			edt_RvadAddr.setValue(sRvadAddr);  

			//납입주기 세팅
			edt_sPaymCyclCd.setValue(cmb_codeHidden.getText());

			//단체할인률 퍼센트
			edt_nGroupDcrt.setValue(wconv.toNumber(DsWs_LTIEA10.getCellData(0, "nGroupDcrt"))*100); 

			//일시납 자동이체 금지
			if(parent.Ds_LTIDA00.getCellData(0,"sPaymCyclCd") == "99"){
				Ds_Subang.setColumnFilter( {type:'row', colIndex:'id_cd', key:'06', condition:'and'});
			}	

			var sCmMetd = parent.Ds_LTIDA00.getCellData(0, "sCmMetd");
			if (mfn_IsEmpty(sCmMetd)){
				cmb_sCmMetd.setSelectedIndex(0);
			}else{
				cmb_sCmMetd.setValue(sCmMetd);	
			}		
			//scwin.cmb_sCmMetd_OnChanged();

	    }

	     return;
	};

