	scwin.btn_Next_onclick = function() {
		var promise = Promise.resolve();

		if(DsWs_LTIDA07.getRowCount() <= 0 
		   && DsWs_LTIDA00.getCellData(0,"sBunsMetdDocuClsfCd") != "3" 
		   && (DsWs_LTIDA00.getCellData(0,"sBunsMetdDocuClsfCd") != "5" || (DsWs_LTIDA00.getCellData(0,"sBunsMetdClsfCd") != "1") )
		   && DsWs_LTIDA00.getCellData(0,"sBunsMetdDocuClsfCd") != "7"
		   && DsWs_LTIDA00.getCellData(0,"sGdCd") != "2900"
		   && DsWs_LTIDA00.getCellData(0,"sGdCd") != "2901"
		   && DsWs_LTIDA00.getCellData(0,"sGdCd") != "2902"  // 2018 상품개정
		   ) {
			alert("고지사항 미입력 계약입니다.");
			return;
		}

		//일시납이 아닐때만, 수금방법check
		if (parent.Ds_LTIDA00.getCellData(0,"sPaymCyclCd") != "99"){		
			if (wconv.length(cmb_sCmMetd.getValue()) == 0){	
				alert("수금방법이 없습니다.");
				return;
			}
		}	

		// 실명확인여부 조회
		var sRealOwnerYN = scwin.lfn_RealOwnerYN();
		if(sRealOwnerYN != "N" && sRealOwnerYN != "Y"){
          alert("고객 실명 확인사항을 입력하세요");
          scwin.btn_ChkReal_onclick();
          return;
    	}

		//2014.10.07 By SDJ(N1410-00035)
	    //사업자 등록번호 4~5번째 자리가 82인 경우 확인창 띄워줌
	    var sCrtorCd = parent.Ds_LTIDA03.getCellData(0, "sCrtorCd");
	    if(wconv.substr(sCrtorCd,3,2) == "82"){
			alert("비영리법인의 경우 설립목적 등에 대한 검증을 위해 정관 등 \n검증가능한 별도 서류를 제출하여야 합니다.");
	    }

        //입금자 모집인동일여부체크
        if(scwin.lfn_selectRecvClprSameYn() == false) {
			alert("모집인과 보험료 입금자는 동일할 수 없습니다.");
			return;
		}

		var sFatcaYNConfirmYN = scwin.lfn_FatcaYNConfirmSearch();
		if(gsSysDate >= "20160101") {
			if(sFatcaYNConfirmYN != "N" && sFatcaYNConfirmYN != "Y"){
				alert(" CRS본인확인 내용을 전산 화면에 등록하고 대면 채널의 경우  확인 서류를 스캔하시기바랍니다.");
				return;
			}
		} else {
			if(wconv.length(parent.Ds_LTIDA03.getCellData(0, "sCrtorCd")) == 13){
				if(sFatcaYNConfirmYN != "N" && sFatcaYNConfirmYN != "Y"){
					alert(" FATCA본인확인 내용을 전산 화면에 등록하고 대면 채널의 경우  확인 서류를 스캔하시기바랍니다.");
					return;
				}
			}
		}

		//지급계좌등록여부확인
		if(scwin.lfn_selectPymAcctRgstYn() == false) {
			alert("환급금계좌를 등록하시기바랍니다.");
			return;
		}

		//계약체결이행동의 대상자 리스트  여기부터 시작 
		//다음단계테스트를 위한 주석처리 추후 풀어줘야함
		if(scwin.lfn_selectPriInfoAgreeList()){
			return;
		}

		// 납입동의가 되었는지 확인. 
		var sCmMetd = DsWs_LTIDA00.getCellData(0,"sCmMetd");
		if (sCmMetd == "05" ||  sCmMetd == "03" )
		{
			promise = promise.then(function(rtnVal) {
				scwin.lfn_selectAgreYn();
	 		});

	 		if (Ds_LTIDA50.getRowCount() == 0 && sCrtorRelnFlag =="40")
			{
				alert("카드소유자 및 예금주의 개인신용정보 동의를 진행하시기 바랍니다.");
				return;
			}
		}

		//다음단계테스트를 위한 주석처리 추후 풀어줘야함
		//대면계약의 경우 이미지 심사 완료 여부 확인 (ldh)
		var ImagJugmYn = false;
		if(sScanObjtYn == "Y"){
			ImagJugmYn = scwin.lfn_selectImageJugm();
			if(!ImagJugmYn){
				//	alert("이미지 심사처리가 완료되지 않았습니다");
				return;
			}
		}

		//자금세탁 방지 위험평가 등급 체크
		var rtn = scwin.lfn_scoreAMLRisk();		
		if(rtn <= "3"){
			alert("자금세탁 위험평가 "+rtn+" 등급입니다.");
		}
		else if(rtn >= "4"){
			alert("자금세탁 위험평가 "+rtn+" 등급입니다. EDD 입력 대상입니다.");
