	  		else{
	  			wconv.clear(DsWs_List);	
				util.jSonDsCreate(_tranSync.getDsJson("CUSAA35"), DsWs_List.getID(),"Y");

	   			var sName = "";
				var resultpia = "N"; 		
		    	if(DsWs_List.getRowCount() > 0){ //Y값은 반드시 있고 N값은 전혀 없어야 함.
		        	if (wconv.findRow(DsWs_List, "sCUSAA35AgmYn", "N") > -1 && 
		        	    wconv.findRow(DsWs_List, "sCUSAA04Expired", "Y") > -1 || 
		        	    wconv.length(DsWs_List.getCellData(wconv.findRow(DsWs_List, "sCUSAA04Expired", "Y"), "sCUSAA04ExpireDate")) ) {
	         				 resultpia =  "N";
					}

					if(wconv.findRow(DsWs_List, "sCUSAA35AgmYn","N") > -1){
						sName = DsWs_List.getCellData(wconv.findRow(DsWs_List, "sCUSAA35AgmYn","N"), "sName") + "님의 동의서 확인에서 계약체결 이행동의를 확인하세요";
						resultpia = "Y"; // needto 동의 
					}					
				}else{
					sName = "계약체결 이행동의를 확인하세요";
					resultpia = "Y"; // needto data가 없는 경우도 동의 필요.
				}

				if (sScanObjtYn == "Y" && resultpia == "Y") {  //대면 계약의 경우.
					alert(sName);
					return true;	
				}
				else if (resultpia == "Y") {
					alert("계약체결 이행동의를 확인하세요");
					return true;
				}	
			}		
		 }
		 else {			
			var MethodObj = new callService("com.inswave.customer.task.CustInfoTask", "checkCUSAA35CUSAA04Info","","");
			MethodObj.setId("checkCUSAA35CUSAA04Info");
			MethodObj.setParam("sApplyNo", parent.Ds_LTIDA03.getCellData(0,"sPlanNo"));
			MethodObj.setParam("sAgmGvs", "10");

			MethodObj.setUrl("/contract/CBSC042MController.do");
			MethodObj.setXPath("//*/vector/data/CUSAA35");
			MethodObj.addXPath("//WARNING");
			MethodObj.sync();
			MethodObj.send();

			wconv.clear(DsWs_Warning);
			util.jSonDsCreate(_tranSync.getDsJson("WARNING"), DsWs_Warning.getID(), "Y");

			// 오류처리
		    if (DsWs_Warning.getRowCount() != 0) {
		        wprom.alert(DsWs_Warning.getCellData(0, "msg"));
		        return;
		    }

		 	wconv.clear(DsWs_CUSAA35);	
			util.jSonDsCreate(_tranSync.getDsJson("CUSAA35"), DsWs_Warning.getID(), "Y");
  			if(DsWs_CUSAA35.getRowCount() > 0) {
  				if(wconv.findRow(DsWs_CUSAA35,"sCUSAA04AgmReq","N") > -1 && 
  				   wconv.findRow(DsWs_CUSAA35,"sCUSAA35AgmReq","N") > -1 && 
  				   wconv.findRow(DsWs_CUSAA35,"sCUSAA35AgmReq","N") > -1) {
  					return false;
  				}    
  				else {
					alert("계약체결 이행동의를 확인하세요");
					//return "Y"; // needto 동의 
					return true;
				}
  			}	
		 }	

		 return false; 		
	}; 

