	scwin.lfn_selectAgreYn = function() {
		wconv.clear(DsWs_LTIDA50) ;//리스트 내용삭제
		var sPlanNo = parent.medt_PlanNo.getValue();
    	var sCmMetd = cmb_sCmMetd.getValue();
	    var sDpsrCd;
	    var sCrtorRelnFlag;

	    if (sCmMetd == "05"){
			sDpsrCd = Div.Ds_LTIFA03.getCellData(0,"sDpsrCd");
			sCrtorRelnFlag = Div.Ds_LTIFA03.getCellData(0,"sCrtorRelnFlag");		
		}else if (sCmMetd == "03"){
			sDpsrCd = Div1.Ds_LTIFA03.getCellData(0,"sDpsrCd");
			sCrtorRelnFlag = Div1.Ds_LTIFA03.getCellData(0,"sCrtorRelnFlag");
		}

	    if (sCrtorRelnFlag == "40")
		{			
			//2014.09.17 By SDJ (N1408-00240)
			//대면일경우는 카드이체도 자동이체로 조회해야함 (※ 제3자동의서 심사 시 납입방법을 자동이체로 세팅하기때문 )
			if(sScanObjtYn =="Y" && sCmMetd == "03"){
				sCmMetd = "05";	
			}

			var MethodObj = new callService("com.inswave.longterm.dpt.rec.task.FAF400Task", "selectRecvAgreYn","","");
			MethodObj.setId("selectRecvAgreYn");
			MethodObj.setParam("sPlanNo", sPlanNo);
			MethodObj.setParam("sCustNo", sDpsrCd);
			MethodObj.setParam("sCmMetd", sCmMetd);	

			MethodObj.setUrl("/contract/CBSC042MController.do");
			MethodObj.setXPath("//*/CUSAA35");
			MethodObj.addXPath("//WARNING");
			MethodObj.sync();
			MethodObj.send();

			wconv.clear(DsWs_Warning);			
			util.jSonDsCreate(_tranSync.getDsJson("WARNING"), DsWs_Warning.getID(), "Y");
			// 오류처리
		    if (DsWs_Warning.getRowCount() != 0) {
		        wprom.alert(DsWs_Warning.getCellData(0, "msg"));
		        return;
		    }
			wconv.clear(DsWs_LTIDA50);
			util.jSonDsCreate(_tranSync.getDsJson("CUSAA35"), DsWs_LTIDA50.getID(), "Y");

		    if(DsWs_LTIDA50.getCellData(0,"sAgmYn") == "Y")
			{
				wconv.clear(Ds_LTIDA50);	
				util.copyM(Ds_LTIDA50, DsWs_LTIDA50.getAllJSON(),true);
				util.setCompBindRefresh(Ds_LTIDA50.getID());
				util.setRowPosition(Ds_LTIDA50, 0);
			}
		}
		else {
			util.appendRow(Ds_LTIDA50);
		}	       

	};

